import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  width: 100%;
`;

export const CoordsContainer = styled.div`
  width: 30%;
`;

export const MapContainer = styled.div`
  width: 60%;
  height: 500px;
`;
